@udf(returnType=StringType())
def random_string(length, extra_characters=""):
    import string, random
    length=int(length) if length is not None else 2
    return "".join([random.choice(string.ascii_lowercase + string.ascii_uppercase + string.digits + extra_characters) for _ in range(length)])

